import PropTypes from "prop-types";
//import "antd/dist/antd.css";

// Component : pagesの各ファイルのreturn componentが入る

const App = ({ Component }) => {
  return (
    <>
      <div>hell</div>
      <Component />
    </>
  );
};

App.propTypes = {
  Component: PropTypes.elementType.isRequired,
};

export default App;
